import React,{Component} from 'react';
import { Button,WhiteSpace} from 'antd-mobile';



export default class Header extends Component {
    render(){
        return(
            <div className="header">
                <Button type="primary">primary</Button><WhiteSpace />
            </div>
        )
    }

}
